import React from 'react';
// import UButton from './UButton';
// import Button from 'react-bootstrap/Button';

import BlackOutlined from './../static/images/extruder/Unite3D-extruder-black-no-background.png'
import PurpleOutlined from './../static/images/extruder/Unite3D-extruder-purple-no-background.png'
import WhiteOutlined from './../static/images/extruder/Unite3D-extruder-white-no-background.png'
import Long from './../static/images/extruder/Unite3D-long-logo.png'

export default class ULogo extends React.Component {

  constructor(props) {
    super(props);
    this.color = props.color
    this.long = props.long
    this.height = props.height
  }

  logo() {
    if (this.long) {
      return (
        <img
            alt=""
            src={Long}
            height={this.height}
          />
      )
    }
    else {
      switch(this.color) {
        case 'purple':
          return (
            <img
              alt=""
              src={PurpleOutlined}
              height={this.height}
            />
          )
        case 'white':
          return (
            <img
              alt=""
              src={WhiteOutlined}
              height={this.height}
            />
          )
        default:
          return (
            <img
              alt=""
              src={BlackOutlined}
              height={this.height}
            />
          )
      }
    }
  }

  render() {
    return (
      this.logo()
    )
  }
}
